building_utility_baseline_description:
{The baseline was generated using a change point regression model to correlate daily electric data (October 2017 through September 2018) and average daily temperature for both weekdays and
weekends.,The baseline uses a change point linear regression model to correlate monthly natural gas use per day with average monthly temperature. Baseline period is from September 2017 through August
2018.,}

